import React from 'react'

const MoreInfo = ({moreInfoRecipe, saveRecipe, mealid}) => {
    const infoList = moreInfoRecipe.moreInfoResult.map(nutrient => {
        return ( 
            <div className="more-info-container" key={moreInfoRecipe.recipeid}>
                <p>{nutrient.title}: {nutrient.amount}</p>
                <button id="add-recipe-button" onClick={() => {saveRecipe(mealid)}}>Add recipe</button>
            </div>
        )
    })

    return (
        <>
            {infoList}
        </>
    )
}

export default MoreInfo
